'use strict';

class FormEnd{
    constructor(form, generator){
        this.form = form;
        this.generator = generator;
    }

    render(){
        let str = '';
        if(this.form.renderRest === undefined || this.form.renderRest == true){
            str += this.generator.rest(this.form);
        }
        str += '</form>';
        return str;
    }
}

module.exports = FormEnd;